sys_variable_value.value:
(function execute(inputs, outputs) {
// Only parse the response body if the status code is 200  
if(inputs.status_code == '200') {

  // Parse the response_body input variable and save parsed object as responseObject
  var responseObject = JSON.parse(inputs.response_body);
  // Map the parsed responseObject values to output variables
  outputs.hostname = responseObject.hostname;
  outputs.city = responseObject.city;
  outputs.region = responseObject.region;
  outputs.country = responseObject.country;

  // Split the returned location into separate latitude and longitude values
  // The REST API returns latitude and longitude combined in the loc value. The script splits the loc value into an   // array at the comma and writes the latitude and longitude into separate variables.
  var locArray = responseObject.loc.split(',');
  outputs.longtitude = locArray[0];
  outputs.latitude = locArray[1];

}
})(inputs, outputs);

